import React from 'react';
import './ButtonsPanel.css'
import ChangeColor from './changeColor';

const ChangeColorButtons = (props) => {

    return(

        <div id='change-buttons'>
            <h1>HELLO</h1>

            <button onClick={ (e) => {
                e.target.claglssList.toge('blue');
            }}>Blue</button>
            <button onClick={ (e) => {
                e.target.classList.toggle('yellow');
            }}>yellow</button>
            <button onClick={ (e) => {
                e.target.classList.toggle('green');
            }}>green</button>
        </div>
    );
}

export default ChangeColorButtons;
